import React from "react";
import { useParams, useNavigate } from "react-router-dom";
import { 
  FileText, 
  Calendar, 
  Heart, 
  ChevronLeft,
  Clock
} from "lucide-react";

const PatientDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const patient = {
    id: id,
    name: "John Doe",
    age: 45,
    lastVisit: "2024-04-10",
    nextCheckup: "2024-04-20",
    riskLevel: "Low",
  };

  const ActionCard = ({ icon: Icon, title, description, onClick }) => (
    <div
      onClick={onClick}
      className="bg-white p-6 rounded-lg shadow-sm border border-gray-200 hover:border-blue-500 
        hover:shadow-md transition-all cursor-pointer group"
    >
      <div className="flex items-center space-x-4">
        <div className="p-3 bg-blue-50 rounded-lg group-hover:bg-blue-100 transition-colors">
          <Icon className="w-6 h-6 text-blue-600" />
        </div>
        <div>
          <h3 className="text-lg font-medium text-gray-900">{title}</h3>
          <p className="text-sm text-gray-500">{description}</p>
        </div>
      </div>
    </div>
  );

  // Global back button component for consistent navigation
  const BackButton = () => (
    <button
      onClick={() => navigate(-1)}
      className="flex items-center text-sm text-gray-500 hover:text-gray-700 mb-4 
        transition-colors px-3 py-2 rounded-lg hover:bg-gray-100"
    >
      <ChevronLeft className="w-4 h-4 mr-1" />
      Back
    </button>
  );

  return (
    <div className="space-y-6">
      {/* Header with Back Button */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
        <BackButton />
        <div className="flex justify-between items-start">
          <div>
            <h1 className="text-2xl font-bold text-gray-900">{patient.name}</h1>
            <div className="mt-2 space-y-1">
              <p className="text-gray-500">Patient ID: {patient.id}</p>
              <p className="text-gray-500">Age: {patient.age}</p>
              <p className="text-gray-500">Last Visit: {patient.lastVisit}</p>
              <p className="text-gray-500">Next Checkup: {patient.nextCheckup}</p>
            </div>
          </div>
          <span className={`px-3 py-1 rounded-full text-sm font-medium ${
            patient.riskLevel === "High" 
              ? "bg-red-100 text-red-800" 
              : "bg-green-100 text-green-800"
          }`}>
            {patient.riskLevel} Risk
          </span>
        </div>
      </div>

      {/* Action Cards Grid */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <ActionCard
          icon={Clock}
          title="Schedule Checkup"
          description="Book or view upcoming appointments"
          onClick={() => navigate(`/patients/${id}/checkup`)}
        />
        <ActionCard
          icon={FileText}
          title="Risk Report"
          description="View detailed health risk assessment"
          onClick={() => navigate(`/patients/${id}/risk-report`)}
        />
        <ActionCard
          icon={Heart}
          title="Wellness Plan"
          description="View personalized health recommendations"
          onClick={() => navigate(`/patients/${id}/wellness-plan`)}
        />
      </div>

      {/* Quick Actions */}
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
        <h2 className="text-lg font-medium text-gray-900 mb-4">Quick Actions</h2>
        <div className="flex space-x-4">
          <button 
            onClick={() => navigate(`/patients/${id}/risk-report`)}
            className="px-4 py-2 text-sm font-medium text-blue-600 hover:text-blue-700 
              hover:bg-blue-50 rounded-lg transition-colors"
          >
            Generate Risk Report
          </button>
          <button 
            onClick={() => navigate(`/patients/${id}/wellness-plan`)}
            className="px-4 py-2 text-sm font-medium text-blue-600 hover:text-blue-700 
              hover:bg-blue-50 rounded-lg transition-colors"
          >
            Update Wellness Plan
          </button>
          <button 
            onClick={() => navigate(`/patients/${id}/checkup`)}
            className="px-4 py-2 text-sm font-medium text-blue-600 hover:text-blue-700 
              hover:bg-blue-50 rounded-lg transition-colors"
          >
            Schedule Checkup
          </button>
        </div>
      </div>
    </div>
  );
};

export default PatientDetails;
